    const [posts, setPosts] = useState([]);

    useEffect(() => {
        axios.get('')
        .then(res =>{
          const posts = res.data;
          this.setPosts({ posts });
        })

        }, [])
       
  return (
    <div>
       <ul>
       { this.state.persons.map(person => <li>{person.name}</li>)}
      </ul>
    </div>
   
  );
}


